<?php	require_once ("../lib/common/dao/VO.class.php");	class Projectdomaincontrol extends VO {		private $domainVO;		private $projectVO;		private $domainid;		private $projectid;		public function setDomain($domainVO){			$this->domainVO=$domainVO;		}		public function getDomain(){			return $this->domainVO;		}		public function setProject($projectVO){			$this->projectVO=$projectVO;		}		public function getProject(){			return $this->projectVO;		}		public function setDomainid($domainid){			$this->domainid=$domainid;		}		public function getDomainid(){			return $this->domainid;		}		public function setProjectid($projectid){			$this->projectid=$projectid;		}		public function getProjectid(){			return $this->projectid;		}		public function __toString(){			return "domainid=".$this->domainid."(".$this->domainVO.")".", projectid=".$this->projectid."(".$this->projectVO.")";		}	}?>